import React from 'react'
import { Route, Link } from 'react-router-dom'
const db = firebase.db;

class Challenge extends React.Component {
    render() {
        var picturesRef = db.collection('smiles-ai').doc('PersonsCount');
        var getDoc = picturesRef.get()
            .then(doc => {
                if(!doc.exists) {
                    console.log('No such document!');
                } else {
                    console.log('Document data:', doc.data());
                }
        })
        .catch(err => {
            console.log('Error getting document', err);
        });

        return (
            <div>
                <div class="container ml-5">
                    <header className="Challenge-header">
                        <h1 class="font-weight-bold">Engineering Challenge 2</h1>
                    </header>
                </div>

                <div class="container my-5">
                    <img src="https://us-central1-core-228912.cloudfunctions.net/raspberry-pi-a7?apiKey=MFDW!!HQ_!CCPK?Q?QJEGAKQ!ENFM%3C%3E(XGQ}BXAMM%3CQ:&dummy=" class="img-fluid" alt="Responsive image"></img>
                </div>

                <div class="container my-5">
                    <table class="table table-striped">
                        <thead>
                            <tr>
                            <th scope="col">#</th>
                            <th scope="col">picture name</th>
                            <th scope="col"># persons</th>
                            <th scope="col">time</th>
                            </tr>
                        </thead>

                        <tbody>
                            <tr>
                            <th scope="row">1</th>
                            <td>Mark</td>
                            <td>Otto</td>
                            <td>@mdo</td>
                            </tr>
                            <tr>
                            <th scope="row">2</th>
                            <td>Jacob</td>
                            <td>Thornton</td>
                            <td>@fat</td>
                            </tr>
                            <tr>
                            <th scope="row">3</th>
                            <td>Larry</td>
                            <td>the Bird</td>
                            <td>@twitter</td>
                            </tr>
                        </tbody>
                    </table>
                </div>

            </div>
        )
    }
}

export default Challenge
